itted via intake forms for default feature pricing.\n- **Limitations**:\n  - Only tied to standard consumption meters.\n\n---\n\n#### Promotions (Price Overrides):\n- **Definition**: Temporary price reductions for specific services or products.\n- **Requirements**:\n  - Well-defined objectives, eligibility criteria, measurable outcomes, and duration (6-12 months max).\n- **Governance**: Promo Council ensures compliance and transparency.\n\n---\n\n#### Telco Configuration:\n- **Products**: Azure Communication Services utilizing PSTN for phone calls, SMS, etc.\n- **Tax & Finance**:\n  - Global-only regions supported.\n  - Telco configurations include inbound/outbound differentiation, no sovereign clouds, and tax inclusivity requirements.\n- **Setup**: Special requirements for claims, tax configurations, and $1 pricing meters for consumption-based charges.\n\nThis document provides detailed guidelines and processes for managing Azure pricing tools, free offers, trials, pricing mechanisms, promotional discounts, and Telco services.","annotations":[]}}],"attachments":[],"metadata":{}}

